import React from "react";
import Card from './Cards';
import './index.css';
import Sdata from "./Sdata";


console.log(Sdata[0].sname);
function ncard(val){
    console.log(val)
    return (
        <Card
            imgsrc={val.imgscr}
            title={val.sname}
            link={val.links}

        />
    )

}

function App(){
    return (
        <>
            <h1 className="heading_style">Netflix movies</h1>
            
            Sdata.map(ncard)
        </>
    )
}

export default App;
